import React, { Component } from 'react';
import { Parallax } from 'react-parallax';


import './Home.css';
const image1 = "./imgs/frontPatio.jpg"
const image2 = "./imgs/logo.png";


class HomePage extends Component {
    render() {
        return (
           <div className="homePage">
                {/* FRONT PAGE */}
                <div>
                <div className="mainContent">
                    <p>Shore Grill and Grotto offers a casually elegant dining experience in a sophisticated lounge-like setting or in our attractive dining room. The intimate atmosphere provides an unparalleled experience allowing you to enjoy our unconventional spin on some delicious menu items such as a stone fired pizza, our generous pasta creations or indulging in some of our signature seafood items. <br/>Whether you're entertaining guests or feeling like a social night out paired with live music, Shore Grill and Grotto is pleased to be your host in our ever evolving (and sometimes outlandish) lounge and restaurant style concept our eclectic team are ready to make your visit memorable. </p>
                </div>
                </div>


                {/* AREAS/PARALLAX SECTION */}
                <div> 
                <Parallax 
                    bgImage={image1} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image1} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image1} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               </div>



           </div>
        )
    }   
}


export default HomePage;
